import React from 'react';
import ReactDOM from 'react-dom';
import {Jumbotron} from './components/jumbotron';


function App() {
    return (
      <div className="App">
          <Jumbotron name = "Digimon World OOP Order II"/>
      </div>
    );
}


ReactDOM.render(<App />, document.getElementById('root'));
